import './App.css';
import {MessageList} from "./MessageList";
import React, { useState, useEffect } from "react";
import { useQuery } from "react-query";

const getFiles=()=>{
    return fetch("http://localhost:8080/messages").then((response) => response.json())
}


function App() {
    const [files, setFiles] = useState([]);

    useEffect(() => {
        const query = useQuery("files", getFiles);
        query.subscribe((data) => setFiles(data));
    }, []);

  return (
    <div className="App">
      <MessageList text={"Hello"}/>
    </div>
  );
}

export default App;
